import React from "react";

const skills = [
  {
    id: 1,
    img: "SiHtml5",
    category: "Front-end",
    level: 5,
  },
];

const SkillList = () => {
  return skills.map((skill) => <Skill skills={skill}></Skill>);
};

const Skill = ({ skill }) => {
  return <div>{skill.id}</div>;
};

export default SkillList;
